import React from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const Logout = () => {
    const navigate = useNavigate();

    const handleLogout = async () => {
        try {
            // Gọi API để thực hiện logout từ server
            await axios.post("http://localhost:8080/api/users/logout");

            // Điều hướng đến trang đăng nhập hoặc trang chính (tùy thuộc vào yêu cầu của bạn)
            navigate('/login');
        } catch (error) {
            console.error("Logout failed:", error);
            // Xử lý lỗi nếu cần
        }
    };

    return (
        <div class="col large-2 large-col-first vertical-thumbnails pb-0">

        <div class="product-thumbnails thumbnails slider row row-small row-slider slider-nav-small small-columns-4 is-draggable flickity-enabled" data-flickity-options="{
                    &quot;cellAlign&quot;: &quot;left&quot;,
                    &quot;wrapAround&quot;: false,
                    &quot;autoPlay&quot;: false,
                    &quot;prevNextButtons&quot;: false,
                    &quot;asNavFor&quot;: &quot;.product-gallery-slider&quot;,
                    &quot;percentPosition&quot;: true,
                    &quot;imagesLoaded&quot;: true,
                    &quot;pageDots&quot;: false,
                    &quot;rightToLeft&quot;: false,
                    &quot;contain&quot;:  true
                }" tabindex="0">        
              <div class="flickity-viewport"style={{position:" absolute", left: "96.31%"}}><div class="flickity-slider" style={{position:" absolute", left: "96.31%"}}><div class="col first" style={{position:" absolute", left: "96.31%"}} aria-hidden="true">
              <a>
                <img src="https://shop.mixigaming.com/wp-content/uploads/2023/11/DUY04433-100x100.jpg" alt="Duy04433" width="100" height="100" class="attachment-woocommerce_thumbnail"/>          </a>
            </div>
            <div class="col" style={{position:" absolute", left: "96.31%"}} aria-hidden="true"><a><img src="https://shop.mixigaming.com/wp-content/uploads/2023/11/DUY04430-100x100.jpg" alt="Duy04430" width="100" height="100" class="attachment-woocommerce_thumbnail"/></a></div>
            <div class="col" style={{position:" absolute", left: "96.31%"}} aria-hidden="true"><a><img src="https://shop.mixigaming.com/wp-content/uploads/2023/11/DUY04433-100x100.jpg" alt="Duy04433" width="100" height="100" class="attachment-woocommerce_thumbnail"/></a></div>
            <div class="col" style={{position:" absolute", left: "96.31%"}} aria-hidden="true"><a><img src="https://shop.mixigaming.com/wp-content/uploads/2023/11/DUY04434-100x100.jpg" alt="Duy04434" width="100" height="100" class="attachment-woocommerce_thumbnail"/></a></div>
            <div class="col is-nav-selected is-selected" style={{position:" absolute", left: "96.31%"}}><a><img src="https://shop.mixigaming.com/wp-content/uploads/2023/11/DUY04435-100x100.jpg" alt="Duy04435" width="100" height="100" class="attachment-woocommerce_thumbnail"/></a></div>
            <div class="col" aria-hidden="true" style={{position:" absolute", left: "96.31%"}}><a><img src="https://shop.mixigaming.com/wp-content/uploads/2023/11/DUY04437-1-100x100.jpg" alt="Duy04437" width="100" height="100" class="attachment-woocommerce_thumbnail"/></a></div>
            <div class="col" aria-hidden="true" style={{position:" absolute", left: "96.31%"}}><a><img src="https://shop.mixigaming.com/wp-content/uploads/2023/11/DUY04439-1-100x100.jpg" alt="Duy04439" width="100" height="100" class="attachment-woocommerce_thumbnail"/></a></div>
            <div class="col" aria-hidden="true"style={{position:" absolute", left: "96.31%"}}><a><img src="https://shop.mixigaming.com/wp-content/uploads/2023/11/DUY04442-100x100.jpg" alt="Duy04442" width="100" height="100" class="attachment-woocommerce_thumbnail"/></a></div>
            </div>
            </div>
            </div>
        </div>

    );
};

export default Logout;
